import state from './redux/state';
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
import { add, addPost, subscribe } from './redux/state';

export let rerenderInfo = (state) => {
  ReactDOM.render(
    <BrowserRouter>
      <App state={state} add={add} addPost={addPost} />
    </BrowserRouter>,
    document.getElementById('root')
  );
};

rerenderInfo(state);

subscribe(rerenderInfo);

